  \"2016-10-26T04:49:24.150047\",\n\t\"name\": \"modflow2005-model-used-to-simulate-the-effects-of-groundwater-withdrawals-from-aquifers-in-ocea\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"A three-dimensional groundwater flow model
  was developed to simulate the effects of withdrawals on the groundwater-flow systems
  of five aquifers in and around Ocean County, New Jerseyu00e2u0080u0094the unconfined
  Kirkwood-Cohansey aquifer system and Vincentown aquifer, and three confined aquifers--the
  Rio Grande water-bearing zone, the Atlantic City 800-foot sand, and the Piney Point
  aquifer. A transient model was used to simulate conditions that represent no groundwater
  withdrawals, 2000u00e2u0080u00932003 groundwater withdrawals, and maximum-allocation
  groundwater withdrawals. Particle-tracking analysis, using results from two steady-state
  simulations, determine flow paths and travel times to near-shore wells screened
  in the unconfined Kirkwood-Cohansey aquifer system, the Rio Grande water-bearing
  zone, and the Atlantic City 800-foot sand. Sources of water to wells in both unconfined
  and confined aquifers and travel times based on particle-tracking analysis are used
  to assess the susceptibility of selected wells to saltwater intrusion from bay or
  ocean water. This USGS data release contains all of the input and output files for
  the simulations described in the associated model documentation report (http://dx.doi.org/10.3133/sir20165035).\",\n\t\"license_title\":
